import React from "react";
import Redirect from "react-dom";
import Dashboard from "./dashboard.component";

export default function SecuredRoute(props) {
  <Route
    {...props}
    render={(props) =>
      props.LoggedInStatus === "LOGGED_IN" ? (
        <Dashboard {...props} />
      ) : (
        <Redirect
          to={{
            pathname: "/",
          }}
        />
      )
    }
  />;
}
